INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('Druk', 24, 09, 2020, 'Fire gymnasielærere og venner beslutter sig for at teste en teori om, at mennesket er født med en halv promille for lidt. Teorien lyder, at alkohol i blodet åbner sindet for omverdenen og får kreativiteten til at stige. Resultatet er opsigtsvækkende. Både undervisningen og resultaterne løfter sig, og vennerne begynder for alvor at mærke livet igen. I takt med at genstandene ryger indenbords, skrider eksperimentet fremad for nogle og af sporet for andre. Det bliver tydeligt, at alkohol kan skabe store resultater, men også at den slags vovemod kan have konsekvenser. Filmen er et drama om venskab, frihed, kærlighed – og alkohol.', '2GIHLUjKfGgrqoP5F1WxBwG62HO.jpg', 1);
INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('Hjælp, jeg er en fisk', 06, 10, 2000, 'En fejlslagen fisketur bringer de tre børn Svip, Stella og Plum på afveje. De havner hos den mystiske Professor Mac Krell, som har opfundet en eliksir, der gør det muligt for mennesker at leve under vand. Stella kommer til at drikke af eliksiren, og straks forvandles hun til en søstjerne. For at redde hende må de to andre følge efter - Plum som vandman og Svip som fisk. De har nøgagtig 48 timer til at finde Stella og modgiften. Hvis ikke, vil de forblive fisk for evigt...', 'a23RtDALCStPJsvFIqctkggNbto.jpg', 2);
INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('Klovn forever', 24, 09, 2015, 'Fem år er gået siden sidst, og Casper og Frank står ved en skillevej. Hvad er det de vil? Og hvad betyder de egentlig for hinanden, når det kommer til stykket? Venskabet sættes på den ultimative test, og undervejs udsætter Casper og Frank sig selv og hinanden for deres livs prøvelser - både i trygge omgivelser herhjemme og tværs over Atlanten i Drømmenes By, Los Angeles. Her flytter Casper hen for at forfølge sin karriere, men for at redde venskabet sætter Frank efter ham. I sidste ende må de to venner stille sig selv spørgsmålet: Eksisterer der overhovedet sådan noget som "venner for evigt"? Og hvad skal man hævne, og hvad skal man tilgive her i livet? Én ting er sikkert: Nu er det alvor!', 'jteC4dM99UmueJQPgAdYsD2jTNq.jpg', 3);
INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('Flammen og Citronen', 25, 03, 2008, 'Under nazisternes besættelse tog rødhårede Bent Faurschou-Hviid (Flammen) og Jørgen Haagen Schmith (Citronen), lejemordere i den danske modstandsbevægelse, ordrer fra Winther, som var i direkte kontakt med de allieredes ledere. En skød, den anden kørte. Frem til 1944 dræbte de kun danskere; hvorefter Winther giver ordre til at dræbe tyskere. Da et offer fortæller Bent, at Winther udnytter dem til afregne private forhold, sætter tvivlen in. Det kompliceres af Bents forhold til den mystiske Kitty Selmer, der kan være en dobbelt agent. Desuden er der en forræder i deres omgangskreds. Kan Bent og Jørgen dræbe et über-mål, undgå at blive taget til fange og overleve krigen? Og er det heltemod, naivitet eller blot had?', '384NwhPsZbZKOPrF1QPI9ShNj6z.jpg', 3);
INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('Kartellet', 27, 02, 2014, 'Efter nogle år i udlandet vender den unge entreprenør Lars Halbo hjem til Danmark for at overtage sin fars el- og VVS-firma. Men Lars'' stolte og stædige enegang gør ham upopulær i branchen, der er gennemsyret af korruption og kartelvirksomhed. Lars nægter at indgå ulovlige prisaftaler med de store byggeselskaber, og det sætter både ham selv, hans firma og hans familie under voldsomt pres.', 'wVWo0NE6FNGwW3EAwbrUfKL7hxP.jpg', 4);
INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('Skytten', 27, 02, 2013, 'Den nye danske regering har, stik imod sine valgløfter, annonceret olieboringer i Grønland, men da journalisten Mia Moesgaard forudsiger en voldsom offentlig reaktion på det miljømæssige forræderi, tager en enlig mand sagen i sin egen hånd. Den begavede og bestemte snigskytte holder København i et panisk jerngreb og demokratiets værste mareridt er en realitet.', 'isN9vzQXvL5L3VkWfbllhWP3EHs.jpg', 2);
INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('Krummerne 3 - fars gode idé', 25, 12, 1994, 'Da familien Krumborg (Karen Lise Mynster, Dick Kaysø, Benjamin Rothenborg Vibe, Line Kruse og Lukas Forchammer) flytter tilbage i deres gamle lejlighed, sker der ting og sager. For samtidig har Ivan (Jarl Friis-Mikkelsen) og Boris (Peter Schrøder), de to ærketumpede forbrydere, tænkt sig at udføre deres næste ''geniale'' kup i Krummernes hus. Som sædvanlig er det Ivan, der må pukle, da Boris har fundet en passende stilling til ham som viceværtassistent i huset. Hermed har de adgang til alle lejlighederne - og uheldigvis for dem også til den ikke helt almindelige Krummefamilies hyggelige hule.', '5SOis8uVlSuHkGpavIoSMNlH1m8.jpg', 5);
INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('Badehotellet', 30, 12, 2013, 'I sæsonpremieren slår Amanda for første gang dørene op til det nordjyske badehotel, hvor hun er ny forpagter af hotellet med kyndig hjælp fra vennen Philip Dupont i køkkenet. Uheldigvis er 1940 Amandas første sommer som ejer af hotellet. Så hun er med god grund spændt på, om gæsterne vil komme, når de er nødt til at rejse den lange vej med tog og rutebil, fordi privat bilkørsel er blevet forbudt.', '2YrFeKSc23Glr9g3GSgOclEjizd.jpg', 2);
INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('Natholdet', 27, 09, 2010, 'Der er masser af muligheder for gode grin, når Anders Breinholt i selskab med medværter kaster sit falkeblik på de absurditeter og morsomheder, som det danske medielandskab er fuldt af.', 'fgCVmJYwa1LSlVKwuwb0CoWqu7o.jpg', 6);
INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('LEGO Masters Danmark', 16, 04, 2021, 'Otte par, der alle er særligt dygtige til at bygge med LEGO®, dyster i otte programmer om at blive vindere af ''LEGO Masters''. De har tre millioner LEGO-klodser at gøre godt med, når de på tid skal skabe kreative og fascinerende byggerier.', 'icivSSOcnTUMfrGrSrKOxUmU1CM.jpg', 2);
INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('Sygeplejeskolen', 21, 10, 2018, 'Da Danmark i 1950''erne - efter Anden Verdenskrig - oplevede stor mangel på sygeplejersker, opstod et usædvanligt eksperiment. For første gang i historien blev mænd optaget på sygeplejeskolen og fik dermed chancen for vise, at de også kunne gøre en forskel for patienter og pårørende på lige fod med kvindelige sygeplejeelever.', '5VqBAFZOc2nKmR1qUTOnv5M0DeY.jpg', 2);
INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('X Factor', 04, 01, 2008, '''X Factor'' er hele Danmarks underholdningsprogram, men hvem har modet til at stille sig op og synge foran dommerbordet - og talentet til at gå videre?', 'c3TSHxXH9biaFCw7kTHDopF3F7f.jpg', 7);
INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('Langt fra Las Vegas', 27, 02, 2001, 'Programmet ''Jumpstart'' og den tilhørende redaktion er omdrejningspunktet i denne geniale sitcom skabt af Casper Christensen og Frank Hvam. Den skrupskøre redaktion er så upolitiske korrekte som noget kan være, og det er både pinligt, sjovt og hjertevarmt, når de på bedste vis prøver at tage fusen på hinanden i kampen om penge, sex og jobs.', '2kmHEFTlRCHYZi6qU3mJMvsy9vN.jpg', 8);
INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('Stormester', 25, 08, 2018, 'Lasse Rimmer er stormester og står klar med masser af krøllede opgaver til fem kendte danskere.', '6AR1pEgAjPNOviellOXCKjkvOz9.jpg', 8);
INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('Krejlerkongen', 03, 08, 2015, 'Hvem er bedst til at bluffe, gætte, købe og sælge sig igennem en masse loppefund og tjene de fleste penge? Krejlerkongen er et helt nyt format, der bringer genbrugs-dillen og den hyggelige, danske krejlerstemning ind i studiet i en morsom og medrivende gætte-med-leg, som man også kan blive lidt klogere af.', 'gFnslggCqedUIKKq0LOcPKkl36a.jpg', 2);
INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('ZULU Djævleræs', 12, 04, 2007, 'Zulu Djævleræs består i at nogle kendte danskere skal køre ræs på Nysumbanen i Nordjylland og afprøve deres evner inden for racerkørsel.  De kendte kører to og to, hvor mændene kører første heat, kvinderne andet heat, og i tredje heat vælger de selv, hvem der styrer de hærgede biler.  Netop tredje heat byder også på alverdens mærkelige trafikale overraskelser, f.eks campingvogne på bilerne og forhindringer på banen.  De kendte kørere skal forsøge at styre, skramle og mase sig vej til den store finale, der består af seks par af de oprindelige 20.', 'ebZbw5B4VY0BQO9kHu6AjgNa4qy.jpg', 2);
INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('Nybyggerne', 09, 10, 2013, 'Fire vidt forskellige par har taget imod en kæmpe udfordring: De skal flytte ind i hvert deres ufærdige typehus, og på bare ni uger skal de gøre det til deres drømmehjem. De har kun 350.000 kroner at gøre det for, og ingen af parrene har nogen som helst håndværkererfaring.', '5bJS3NfBPcbJGUBhYqpxxHbe4CP.jpg', 2);
INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('Lærkevej', 24, 09, 2009, 'På Lærkevej er der mange hemmeligheder og endnu flere nysgerrige naboer - og ikke alt kan holdes hemmeligt bag ligusterhækken!', 'rLAzCMjMDgPJp4UKWJWOToeOPsV.jpg', 2);
INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('Voice Junior', 12, 04, 2014, 'I ’Voice Junior’ skal de unge, talentfulde sangere med blot én sang blæse de tre coaches bagover og overbevise dem om, at de skal med videre.', '1hWcM3evoELDNVeAB7hPGzoH1i4.jpg', 2);
INSERT INTO production (name, release_day, release_month, release_year, description, image, producer_id) VALUES ('Klipfiskerne', 09, 03, 2013, 'TikTok møder ''Hvem vil være millionær?'', når Thomas Warberg og Heino Hansen quizzer fire kendte komikere i internettets sjoveste og mest mærkværdige klip.', 'zo2m2fGKE8kh8OpDPW8rRxcnFRS.jpg', 2);
